  false,\n\t\"url\": null,\n\t\"notes\": \"LAKE_BATHYMETRY_IDNR_IN.SHP provides bathymetric
  contours for the following 85 lakes in Indiana, with depths calculated from the
  average shoreline of each lake: Adams Lake, Appleman Lake, Atwood Lake, Banning
  Lake, Bass Lake, Bear Lake, Big Lake, Big Long Lake, Blackcat Lake, Bluegrass Lake,
  Brokesha Lake, Cass Lake, Cedar Lake, Clear Lake, Cree Lake, Crooked Lake, Dale
  Lake, Dewart Lake, Duck Lake, Emma Lake, Evertt Lake, Flint Lake, Gage Lake, Gilbert
  Lake, Graveyard Lake, Green Lake, Griffy Lake, Hackenberg Lake, Heaton Lake, Henry
  Lake, Hill Lake, Hindman Lake, Hudson Lake, Huntingburg Lake, Indian Lake, Jones
  Lake, Koontz Lake, Kuhn Lake, Lake of the Woods, Latta Lake, Lime Lake, Lindsey
  Lake, Little Barbee Lake, Little Otter Lake, Little Pike Lake, Little Turkey Lake,
  Loomis Lake, Loon Lake, McClures Lake, Meserve Lake, Messick Lake, Meteer Lake,
  Mud Lake, Nauvoo Lake, North Little Lake, Nyona Lake, Otter Lake, Pike Lake, Pleasant
  Lake, Pretty Lake, Riddles Lake, Rider Pond, Robinson Lake, Round Lake, Shipshewana
  Lake, Silver Lake, Simonton Lake, South Mud Lake, Starve Hollow Lake, Steinbarger
  Lake, Stone Lake, Tamarack Lake, Taylor Lake, Thomas Lake, Upper Long Lake, Waldron
  Lake, Wall Lake, Waubee Lake, Waveland Lake, West Boggs Lake, West Lake, West Otter
  Lake, Westler Lake, Witmer Lake, and Yellowwod Lake. The following is excerpted
  from the metadata provided by IDNR, Division of Outdoor Recreation, for the source
  feature class named LAKE_BATHYMETRY_DNR_IN: \"Lake_Bathymetry_DNR_IN is a polyine
  feature dataset of bathymetric contours for certain Indiana lakes, depicting the
  depths of the water with the shoreline of each lake as elevation 0. Contour intervals
  are 5 feet for most lakes, 2 feet for some. Lakes were surveyed using Biosonics
  DTX Echosounder surface unit and 200 kHz and 420 kHz transducers. The contour values
  of some lakes were adjusted to coincide with the lake's legal gauge level.\"\",\n\t\"owner_org\":
